INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0.0, "あたしだって\nやるときはやるよ！", 24001, 102601, 1);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 1, 1, 0.0, 0.0, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", 24002, 102601, 1);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 2, 1, 0.0, 0.0, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", 24003, 102601, 1);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 3, 2, 0.0, 0.0, 0.0, "やったね！\nこれでようやく\nサボれるよ…", 24004, 102601, 2);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 4, 1, 0.0, 0.0, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 24005, 102601, 1);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 5, 2, 0.0, 0.0, 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 24006, 102601, 2);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 6, 2, 0.0, 0.0, 0.0, "あたしも意外と\nやるもんでしょ？", 24007, 102601, 2);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 7, 4, 0.0, 0.0, 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 24008, 102601, 4);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 8, 4, 0.0, 0.0, 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", 24009, 102601, 4);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 9, 4, 0.0, 0.0, 0.0, "まじめに\nやったんだけどな…\n悔しいな～", 24010, 102601, 4);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10, 4, 0.0, 0.0, 0.0, "やられた…\nねずみって意外と\nてごわいね", 24011, 102601, 4);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 11, 4, 0.0, 0.0, 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", 24012, 102601, 4);
INSERT INTO `v1_37a3d8aca20b8b3c5816f8fd5b8d5cbc8cc26e6ec4af250f0907f2c8598e057d` VALUES (10040, 24, "リン", "2020/04/30 12:00:00", "2030/12/17 14:59:59", 12, 1, 0.0, 1.81, 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…", 24013, 102601, 4);
